    var data=[]

    const combine=personal_sidebar.concat(log_out)
    if(page===personal_sidebar[0]){
        data=[]
    }
    else

    useEffect(() => {
        if(combine.indexOf(page)===-1){
            navigate('/access====>error2348138%@&EG&#@&#(#**$)HHefuh2')
        }else if(article_page){
            navigate('/access====>error2348138%@&EG&#@&#(#**$)HHefuh2')
        }
    });

    return(

    <>
    <div className="head">
        <Title sidebar_arr={personal_sidebar}/>
        <Sidebar sidebar_arr={combine} style={"lesssmall"} />
        <Sidebar sidebar_arr={combine} style={"small"} />
    </div>

    <div className="body">
        <Sidebar sidebar_arr={combine} style={"large"}/>
        <Article data={data}/>
    </div>
    </>

    )
}
export default Personal;
